import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import reportWebVitals from './reportWebVitals';

const styles = {
  body: {
    margin: 0,
    fontFamily: `-apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Oxygen', 
      'Ubuntu', 'Cantarell', 'Fira Sans', 'Droid Sans', 'Helvetica Neue', sans-serif`,
    WebkitFontSmoothing: 'antialiased',
    MozOsxFontSmoothing: 'grayscale',
  },
  code: {
    fontFamily: `'source-code-pro', Menlo, Monaco, Consolas, 'Courier New', monospace`,
  },
  overlayText: {
    fontFamily: "'Dancing Script', cursive",
  },
};

// Apply global styles directly to the `body` and other elements
document.body.style.margin = styles.body.margin;
document.body.style.fontFamily = styles.body.fontFamily;
document.body.style.WebkitFontSmoothing = styles.body.WebkitFontSmoothing;
document.body.style.MozOsxFontSmoothing = styles.body.MozOsxFontSmoothing;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
